    const chargerElements = [];
    var ab=1
      for (let j = 1; j <=5; j++) {
        for (let i = 1; i<=5; i++) {
          const element = (
            <>

            <div
              key={`charger${ab}`} 
              id={`charger${ab}`}
              style={{
                // Add other styles here
                backgroundColor: '#cbcbcb',
                // border: '5px',
                // borderStyle: 'solid',
                color: 'white',
                // zIndex: 
                textAlign:'right',

                // borderColor:'#FCE205',
                fontSize:"18px",
                position: 'absolute',
                width: '5%',
                borderRadius:10,
                height:'25px',
                // Set the width and position based on j and i
                left: `${18+(j * 6)}%`, // Adjust this according to your needs
                top: `${2+(i * 8)}%`,
              }}
            >
              {i%2!=0?<div style={{height:10,width:'120%',margin:'auto',backgroundColor:'blue',marginTop:'42px'}}></div>:null}

              {i%2!=0?<p style={{marginTop:'-50px'}}>{ab}</p>:<>{ab}</>}
              {/* {ab} */}
              {/* {i==9?<div style={{width:'120%',height:1,border:'solid 2px black',marginBottom:'-25px'}}/>:null} */}


              {/* {j}{i} */}
            </div>
            </>
          );
      ab+=1
          chargerElements.push(element);
        }
        <hr style={{width:'100%',top:60}}/>
      }
    return (
      <div className="App">
        <Grid container >
        <Grid  xs={8}>
  {chargerElements}
  </Grid>
  </Grid>

      </div>
    );
  }

  export default Parallel;
